<!DOCTYPE html>
<html>
<head>
	<script type="text/javascript" src="data:text/javascript;base64,"></script>
	<title>
		Project Portal
	</title>
	<style type="text/css">
		@import url('https://fonts.googleapis.com/css2?family=Ubuntu&display=swap');
		button:focus, input:focus{
			outline: none;
		}
		*{
			font-family: Verdana, sans-serif;
			font-family: 'Ubuntu', sans-serif;
			color: white;
		}

		html,body{
			width: 100vw;
			background: #101010;
			overflow-x: hidden;
		}

		h1{
			font-size: 3em;
			text-align: center;
		}

		h2{
			font-size: 2em;
		}

		a{
			text-decoration: none;

		}

		main{
			width: 66vw;
			margin: auto;

			display: flex;
			justify-content: center;
			align-items: center;
			flex-wrap: wrap;
		}

		form{
			width: 100%;

			display: flex;
			justify-content: center;
			align-items: center;
		}

		form input{
			width: 80%;
			padding: 0.25em;

			font-size: 3em;

			background: none;
			border: 2px solid white;
			border-radius: 10px;
		}

		.card-wrap{
			position: relative;
			width: 300px;
			height: 150px;
			margin: 2em;
			
		}

		.card-wrap:nth-child(even):hover a{
			transform: translate(-10%, -10%);
		}.card-wrap:nth-child(odd):hover a{
			transform: translate(10%, -10%);
		}

		.card-wrap:hover .card{
			background: rgba(255,255,255,1);
			border: 2px solid #39e47e;
		}

		.card-wrap:hover .card h2{
			color: #39e47e;
			text-shadow: 2px 2px 3px black;
		}

		.card{
			position: absolute;
			width: 300px;
			height: 150px;

			display: flex;
			justify-content: center;
			align-items: center;

			background: rgba(0,0,0,0);
			transition: 0.33s ease;
			border: 2px solid white;
			border-radius: 10px;
		}

		.card h2{
		}

		.card-outline{
			width: 300px;
			height: 150px;
			border: 2px dotted white;
			border-radius: 10px;
		}
	</style>
</head>
<body>
	<h1>~ Projects Portal ~</h1>
	<main id="app">
		<form>
			<input v-model="search">
		</form>

		<div class="card-wrap" v-for="item in filter">
			<a class="card" :href="item">
				<h2>{{ item }}</h2>
			</a>
			<div class="card-outline"></div>
		</div>
	</main>
</body>
<script type="text/javascript">
	var projects = <?php 
		$ignoreList = array(
			"index.php"
		);

		$root = __DIR__;
		foreach (glob('*') as $file) {
		    $file = realpath($file);
		    $link = substr($file, strlen($root) + 1);

		    if ($link[0] != '_' && !(in_array($link, $ignoreList))) {
		    	$out[] = urlencode($link);
		    }
		}
		echo json_encode($out);
	?>;

	var vm = new Vue({
		el: "#app",
		data: {
			projects: projects,
			search: ""
		},
		computed:{
			filter: function(){
				return this.projects.filter(item => {
					return item.toLowerCase().includes(this.search);
				});
			}
		}
	});
</script>
</html>